/**
 * Interface for the data structure generated by the generateDynamicData function.
 * Represents a single data item with fields for order details, customer information,
 * and shipping data, compatible with DataSourceItem for the Grid component.
 */
export interface DynamicDataItem {
    /**
     * Unique identifier for the order.
     */
    OrderID: number;

    /**
     * Indicates whether the order is active.
     */
    IsActive: boolean;

    /**
     * Freight cost for the order.
     */
    Freight: number;

    /**
     * Salary value for the order (purpose unclear, possibly a custom field).
     */
    Salary: number;

    /**
     * Cost value for the order (purpose unclear, possibly a custom field).
     */
    Cost: number;

    /**
     * Date the order was placed.
     */
    OrderDate: Date;

    /**
     * Date the order was shipped.
     */
    ShippedDate: Date;

    /**
     * Unique identifier for the customer.
     */
    CustomerID: string;

    /**
     * Name of the customer.
     */
    CustomerName: string;

    /**
     * Shipping address for the order.
     */
    ShipAddress: string;

    /**
     * Shipping region for the order, can be null.
     */
    ShipRegion: string | null;

    /**
     * Shipping country for the order.
     */
    ShipCountry: string;

    /**
     * City for the shipping destination.
     */
    ShipCity: string;

    /**
     * Name of the shipping company or recipient.
     */
    ShipName: string;

    /**
     * Nested object containing additional shipping details.
     */
    Complex: {
        /**
         * Name of the shipping company or recipient.
         */
        ShipName: string;

        /**
         * City for the shipping destination.
         */
        ShipCity: string;
    };
};
// Function to generate dynamic data for performance testing with all fields preserved
export const generateDynamicData = (count: number): any[] => {
    // Use the first 10 items as a template
    const templateData = data.slice(0, 10);
    const result = [];
    
    // Generate the specified number of records
    for (let i = 0; i < count; i++) {
        // Clone a template item (cycling through the templates)
        const template: DynamicDataItem = JSON.parse(JSON.stringify(templateData[i % templateData.length]));
        
        // Modify only specific fields to make it unique
        template.OrderID = 20000 + i;
        template.IsActive = Math.random() > 0.5;
        template.Freight = Math.round(Math.random() * 1000) / 100;
        template.Salary = Math.round(Math.random() * 1000) / 100;
        template.Cost = Math.round(Math.random() * 1000) / 100;
        template.OrderDate = new Date(Date.now() - Math.random() * 365 * 24 * 60 * 60 * 1000);
        template.ShippedDate = new Date(template.OrderDate.getTime() + Math.random() * 30 * 24 * 60 * 60 * 1000);

        // Randomize CustomerID and CustomerName (optional, for more variety)
        const randomCustomerIndex = Math.floor(Math.random() * customerData.length);
        template.CustomerID = customerData[randomCustomerIndex].CustomerID;
        template.CustomerName = customerData[randomCustomerIndex].ContactName;

        // Randomize shipping information (optional, for more variety)
        // template.ShipName = customerData[randomCustomerIndex].CompanyName;
        template.ShipAddress = customerData[randomCustomerIndex].Address;
        template.ShipCity = Math.random() > 0.5 ? template.ShipCity : customerData[randomCustomerIndex].Country.split(' ')[0];
        template.ShipRegion = Math.random() > 0.7 ? null : template.ShipRegion;
        template.ShipCountry = customerData[randomCustomerIndex].Country;
        template.Complex = {
            ShipName: customerData[randomCustomerIndex].CompanyName,
            ShipCity: Math.random() > 0.5 ? template.ShipCity : customerData[randomCustomerIndex].Country.split(' ')[0]
        }
        
        result.push(template);
    }
    
    return result;
};

